import rev from "./Review.module.css";

function Review({props}) {
  const reviews = props.data;
  /* <article className={rev.review}>
     <h2>{review.title}</h2>
     <h3>{review.author}</h3>
     <p>hello</p>
     <p>Image... {review.stars}</p>
     <h4>{review.review}</h4>
     <h5>{review.date}</h5>
       </article>
     */

  const map_reviews = reviews.map((review) => (
    <article className={rev.review}>
   <img src={rev.book_cover} width="400" height="333" />
    </article>
  ));

  return <main className={rev.grid}>{map_reviews}</main>;
}

export default Review;
